public CSVFileParserTest(final File file) throws FileNotFoundException
{
   this.testName = file.getName();
   this.testData = new BufferedReader(new FileReader(file));
}

private String readTestData() throws IOException {
    String line;
    do {
        line = testData.readLine();
    } while (line != null && line.startsWith("#"));
    return line;
}

@Parameters
public static Collection<Object[]> generateData()
{
    final List<Object[]> list = new ArrayList<Object[]>();

    final FilenameFilter filenameFilter = new FilenameFilter() {
        public boolean accept(final File dir, final String name) {
            return name.startsWith("test") && name.endsWith(".txt");
        }
    };
    final File[] files = BASE.listFiles(filenameFilter);
    for(final File f : files){
        list.add(new Object[]{f});
    }
    return list;
}

public boolean accept(final File dir, final String name) {
    return name.startsWith("test") && name.endsWith(".txt");
}

@Test
public void testCSVFile() throws Exception {
    String line = readTestData();
    assertNotNull("file must contain config line", line);
    final String[] split = line.split(" ");
    assertTrue(testName+" require 1 param", split.length >= 1);
     // first line starts with csv data file name
    CSVFormat format = CSVFormat.newFormat(',').withQuoteChar('"');
    boolean checkComments = false;
    for(int i=1; i < split.length; i++) {
        final String option = split[i];
        final String[] option_parts = option.split("=",2);
        if ("IgnoreEmpty".equalsIgnoreCase(option_parts[0])){
            format = format.withIgnoreEmptyLines(Boolean.parseBoolean(option_parts[1]));
        } else if ("IgnoreSpaces".equalsIgnoreCase(option_parts[0])) {
            format = format.withIgnoreSurroundingSpaces(Boolean.parseBoolean(option_parts[1]));
        } else if ("CommentStart".equalsIgnoreCase(option_parts[0])) {
            format = format.withCommentStart(option_parts[1].charAt(0));
        } else if ("CheckComments".equalsIgnoreCase(option_parts[0])) {
            checkComments = true;
        } else {
            fail(testName+" unexpected option: "+option);
        }
    }
    line = readTestData(); // get string version of format
    assertEquals(testName+" Expected format ", line, format.toString());

    // Now parse the file and compare against the expected results
    // We use a buffered reader internally so no need to create one here.
    final CSVParser parser = CSVParser.parse(new File(BASE, split[0]), Charset.defaultCharset(), format);
    for(final CSVRecord record : parser) {
        String parsed = record.toString();
        if (checkComments) {
            final String comment = record.getComment().replace("\n", "\\n");
            if (comment != null) {
                parsed += "#" + comment;
            }
        }
        final int count = record.size();
        assertEquals(testName, readTestData(), count+":"+parsed);
    }
    parser.close();
}

public static Matcher<Token> hasType(final Token.Type expectedType) {
    return new TypeSafeDiagnosingMatcher<Token>() {

        public void describeTo(final Description description) {
            description.appendText("token has type ");
            description.appendValue(expectedType);
        }

        @Override
        protected boolean matchesSafely(final Token item,
                final Description mismatchDescription) {
            mismatchDescription.appendText("token type is ");
            mismatchDescription.appendValue(item.type);
            return item.type == expectedType;
        }
    };
}

public void describeTo(final Description description) {
    description.appendText("token has type ");
    description.appendValue(expectedType);
}

@Override
protected boolean matchesSafely(final Token item,
        final Description mismatchDescription) {
    mismatchDescription.appendText("token type is ");
    mismatchDescription.appendValue(item.type);
    return item.type == expectedType;
}

public static Matcher<Token> hasContent(final String expectedContent) {
    return new TypeSafeDiagnosingMatcher<Token>() {

        public void describeTo(final Description description) {
            description.appendText("token has content ");
            description.appendValue(expectedContent);
        }

        @Override
        protected boolean matchesSafely(final Token item,
                final Description mismatchDescription) {
            mismatchDescription.appendText("token content is ");
            mismatchDescription.appendValue(item.content.toString());
            return expectedContent.equals(item.content.toString());
        }
    };
}

public void describeTo(final Description description) {
    description.appendText("token has content ");
    description.appendValue(expectedContent);
}

@Override
protected boolean matchesSafely(final Token item,
        final Description mismatchDescription) {
    mismatchDescription.appendText("token content is ");
    mismatchDescription.appendValue(item.content.toString());
    return expectedContent.equals(item.content.toString());
}

public static Matcher<Token> isReady() {
    return new TypeSafeDiagnosingMatcher<Token>() {

        public void describeTo(final Description description) {
            description.appendText("token is ready ");
        }

        @Override
        protected boolean matchesSafely(final Token item,
                final Description mismatchDescription) {
            mismatchDescription.appendText("token is not ready ");
            return item.isReady;
        }
    };
}

public void describeTo(final Description description) {
    description.appendText("token is ready ");
}

@Override
protected boolean matchesSafely(final Token item,
        final Description mismatchDescription) {
    mismatchDescription.appendText("token is not ready ");
    return item.isReady;
}

public static Matcher<Token> matches(final Token.Type expectedType, final String expectedContent) {
    return allOf(hasType(expectedType), hasContent(expectedContent));
}

@Before
public void setUp() {
    token = new Token();
    token.type = Token.Type.TOKEN;
    token.isReady = true;
    token.content.append("content");
}

@Test
public void testHasType() {
    assertFalse(hasType(Token.Type.COMMENT).matches(token));
    assertFalse(hasType(Token.Type.EOF).matches(token));
    assertFalse(hasType(Token.Type.EORECORD).matches(token));
    assertTrue(hasType(Token.Type.TOKEN).matches(token));
}

@Test
public void testHasContent() {
    assertFalse(hasContent("This is not the token's content").matches(token));
    assertTrue(hasContent("content").matches(token));
}

@Test
public void testIsReady() {
    assertTrue(isReady().matches(token));
    token.isReady = false;
    assertFalse(isReady().matches(token));
}

@Test
public void testMatches() {
    assertTrue(matches(Token.Type.TOKEN, "content").matches(token));
    assertFalse(matches(Token.Type.EOF, "content").matches(token));
    assertFalse(matches(Token.Type.TOKEN, "not the content").matches(token));
    assertFalse(matches(Token.Type.EORECORD, "not the content").matches(token));
}

